import React from "react";
import CommingSoon from "./CommingSoon";
import "./min.style.css"
function Projects() {
  return (
    <>
      <div id="bg-gradient">
        <div className="container-md contianer-fluid p-5">
          <br />
          <br />
          <br />
          <div className="content">
            <p className="lead text-light display-4" style={style.content}>
              Successfully Completed Projects
              <br />
            </p>
          </div>
          <div className="totla text-white d-flex justify-content-center mt-5 gap-4">
            <p className="h5 lead">
              Successfully Completed Projects, honors our team's perseverance and
              commitment to finishing a range of projects. <br />
              These achievements show our dedication to excellence and our
              capacity for overcoming obstacles to succeed.{" "}
            </p>
          </div>
          <br />
          <br />
        </div>
      </div>
        {/*  Our project has done compeletely */}
        <div className="container-md container-fluid p-5">
          {/*  */}
            <div className="row bg-white p-0 rounded rounded-3">
              <div className="col-12 col-lg-4 p-0">
                  <img src="https://d3bur0e9fyg6zq.cloudfront.net/assets/img/images/our_projects/1.png" className="img-card" alt="" />
              </div>
              <div className="col-12 col-lg-8 text-start p-5">
                <h2 className="text-bold">Outsourcing Recruitment and Payroll Management Services for MTN</h2><br />
                <p className="lead">Jobs.af provides recruitment and payroll services to MTN Afghanistan. The scope of the project is to hire and manage payroll for 629 staff over 15 provinces within two years. Recruitment for the complete target will occur over phases, which the first phase successfully delivered. </p>
              </div>
            </div>
        </div>
    </>
  );
}

const style = {
  content: {
    fontWeight: 500,
    color: "white",
  },
  
};
export default Projects;
